import React from 'react';
import '../../../css/about.css'

function About(){
    return (
        <div>
            <h1> About Me </h1>
            <p className='about'>
                Hello! My name is Vincent Tate and I am a junior developer starting out my new adventure into the field. I come from a long background of leadership and face to face customer service and looking for something new in my career path. 
            </p>
        </div>
    )
}

export default About;
